import React, { Component } from 'react'

export class signup extends Component {

    constructor() {  
        super();  

        this.state = {  
          Email: '', 
          Name: '',
          Mob_no: '', 
          Password: '',
          Re_password: '',
        }  

        this.Email = this.Email.bind(this);  
        this.Password = this.Password.bind(this);  
        this.Name = this.Name.bind(this);  
        this.Re_password = this.Re_password.bind(this);  
        this.Mob_no = this.Mob_no.bind(this);  
        this.register = this.register.bind(this);
    }

    Email(event) {  
        this.setState({ Email: event.target.value })  
    }  

    Mob_no(event) {  
        this.setState({ Mob_no: event.target.value })  
    }  

    Password(event) {  
        this.setState({ Password: event.target.value })  
    } 

    Re_password(event) {  
        this.setState({ Re_password: event.target.value })  
    } 

    Name(event) {  
        this.setState({ Name: event.target.value })  
    }  

    register(event) {  

        console.log(this.state.Name);  
        console.log(this.state.Email);  
        console.log(this.state.Password);  
        console.log(this.state.Mob_no);  
        console.log(this.state.Re_password);  
    }  

    render() {
        return (
            <form>
                <h3>Register</h3>

                <div className="form-group">
                    <label>Email</label>
                    <input type="email" className="form-control" onChange={this.Email} placeholder="Enter email" />
                </div>

                <div className="form-group">
                    <label>Name</label>
                    <input type="text" className="form-control" onChange={this.Name} placeholder="Enter name" />
                </div>

                <div className="form-group">
                    <label>Mob number</label>
                    <input type="text" className="form-control" onChange={this.Mob_no} placeholder="Mob. number" />
                </div>

                <div className="form-group">
                    <label>Password</label>
                    <input type="password" className="form-control" onChange={this.Password} placeholder="Enter password" />
                </div>

                <div className="form-group">
                    <label>Re-password</label>
                    <input type="password" className="form-control" onChange={this.Re_password} placeholder="Enter re-password" />
                </div>

                <button type="submit" onClick={this.register} className="btn btn-dark btn-lg btn-block">Register</button>
                <p className="forgot-password text-right">
                    Already registered <a href="#">log in?</a>
                </p>
            </form>

        )
    }
}

export default signup
